import React, { Component } from 'react';
import Home from './components/home/Home'
import './App.css';

class App extends Component {
    state = {
      fromStation: '',
      toStation: '',
      leavingDate: '',
      leavingTime: '',
      return: false,
      returnDate: '',
      returnTime: '',
      adults: 1,
      kids: 0,
      railcards: '',
    }

  handleChangeFrom = (e) => {
    this.setState({
      fromStation: e.target.value
    })
  }

  checkReturn = (e) => {
    this.setState({
      return: true
    })
  }
  render() {
    return (
      <div className="App">
      <Home checkReturn={this.checkReturn}/>
        {/* <HeaderBar/>

        <Menu/> */}
      </div>
    );
  }
}

export default App;
